DROP TABLE IF EXISTS zt_news
CREATE TABLE `zt_news` (  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '文章id',  `cat_id` int(10) unsigned NOT NULL COMMENT '分类id',  `cat_path` varchar(255) NOT NULL COMMENT '分类路径',  `title` varchar(255) NOT NULL COMMENT '文章标题',  `font_color` varchar(255) DEFAULT NULL COMMENT '标题颜色',  `url` varchar(255) NOT NULL COMMENT '外连内容',  `video` varchar(255) DEFAULT NULL,  `keywords` varchar(255) DEFAULT NULL COMMENT '关键词',  `description` varchar(255) DEFAULT NULL COMMENT '描述',  `picture` varchar(100) NOT NULL,  `content` text NOT NULL COMMENT '内容',  `views` int(11) unsigned NOT NULL DEFAULT '1' COMMENT '浏览量',  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态',  `top` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '置顶',  `recommend` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '推荐',  `create_time` int(10) unsigned NOT NULL COMMENT '创建时间',  `create_uid` int(10) unsigned NOT NULL COMMENT '创建者uid',  `create_username` varchar(20) NOT NULL COMMENT '创建者用户名',  `stepup` int(11) NOT NULL COMMENT '顶',  `stepdown` int(11) NOT NULL COMMENT '踩',  PRIMARY KEY (`id`),  KEY `title` (`title`),  KEY `views` (`views`),  KEY `create_time` (`create_time`)) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='文章信息表';
